INSERT [dbo].[Analyzer] ([AnalyzerId], [AnalyzerName], [CreateTime], [UserId], [SelectQuery], [JoinQuery], [WhereQuery], [IsDeleted]) VALUES (1, N'TurnoverByMonth', CAST(0x0000A26C00A1F478 AS DateTime), 1, N'(case cast(month(ConsumptionRecord.StartTime) as int) when 1 then ''Jan.'' when 2 then ''Feb.'' when 3 then ''Mar.'' when 4 then ''Apr.'' when 5 then ''May'' when 6 then ''Jun.'' when 7 then ''Jul.'' when 8 then ''Aug.'' when 9 then ''Sep.'' when 10 then ''Oct.'' when 11 then ''Nov.'' when 12 then ''Dec.'' End) as [Month],sum(ConsumptionRecord.ConsumptionAmount) as [Turnover] ', N'[ConsumptionRecord][ right join ][GymCard][ on ConsumptionRecord.CardId = GymCard.RowId ][ right join ][Customer] [ on GymCard.CustomerId = Customer.RowId ]', N'  ConsumptionRecord.StartTime >= ''2012-01-01'' and ConsumptionRecord.StartTime <= ''2012-12-31'' Group by month(ConsumptionRecord.StartTime) ', 0)
INSERT [dbo].[Analyzer] ([AnalyzerId], [AnalyzerName], [CreateTime], [UserId], [SelectQuery], [JoinQuery], [WhereQuery], [IsDeleted]) VALUES (2, N'TurnoverByCustomerId', CAST(0x0000A26C00B8BD06 AS DateTime), 1, N' Customer.CustomerId as CustomerId,sum(ConsumptionRecord.ConsumptionAmount) as Turnover ', N'[ConsumptionRecord][ right join ][GymCard][ on ConsumptionRecord.CardId = GymCard.RowId ][ right join ][Customer] [ on GymCard.CustomerId = Customer.RowId ]', N'  1=1 Group by Customer.CustomerId ', 0)
INSERT [dbo].[Analyzer] ([AnalyzerId], [AnalyzerName], [CreateTime], [UserId], [SelectQuery], [JoinQuery], [WhereQuery], [IsDeleted]) VALUES (3, N'UsedSeatByFloor', CAST(0x0000A28300142C74 AS DateTime), 1, N'(case cast(SeatBooking.Floor as int) when 0 then ''Ground Floor'' when 1 then ''2nd Floor'' when 2 then ''3rd Floor'' End) as [Floor],sum(case when ( GETDATE() between SeatBooking.BeginDate and SeatBooking.EndDate ) then 1 else 0 end) as UsedSeat', N'[SeatBooking]', N'  SeatBooking.Building = ''ARHK'' Group by Floor', 0)
SET IDENTITY_INSERT [dbo].[Analyzer] OFF
